import React,{Component} from 'react';

import './CustomNav.css';
export default class ContactUs extends Component{
    render(){
        return(
            <div>
                <main role="main" className="inner cover">
                <h1 className="cover-heading">Contact Us</h1>
                </main>
            </div>
        )
    }
    }
